 // pie\n  showLabels = true;\n  explodeSlices = false;\n  doughnut = false;\n\n  /**\n   * set the dropdown selection and load the new values for the diagramm\n   * @param body \n   */\n  set(body: number): void {\n    var jrk;\n    for (let j of this.JRKEntitaeten) {\n      if (j.id == body) {\n        jrk = j;\n      }\n    }\n    this.rest.getChartValues(jrk).subscribe(value => {\n      this.single = value;\n    });\n\n    this.rest.getLowerEntityHourList(jrk).subscribe(value => {\n      this.single2 = value;\n    });\n\n    this.rest.getYearlyHoursPerPeople(jrk).subscribe(value => {\n      this.single3 = value;\n    });\n\n    this.rest.getTimelineValues(jrk).subscribe(value => {\n      this.singleChartBar = value;\n    });\n    this.rest.getPersonenstunden(jrk).subscribe(value => {\n      this.single4 = value;\n    });\n  }\n\n  onSelect(event) {\n    //console.log(event);\n  }\n}\n\n    \n\n    \n        \n  \n    {{ JRKEntitaet.name }}\n  \n\n\nKategorien\n\n\nAufteilung auf Gruppen\n\n\nZeitleiste\n\n\ngeleistete Stunden\n\n\nPersonenstunden\n\n\n\n    \n\n    \n                \n                    ./diagrams.component.css\n                \n                .abstand{\n    padding-top: 400px;\n}\n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '      {{ JRKEntitaet.name }}  KategorienAufteilung auf GruppenZeitleistegeleistete StundenPersonenstunden'\n    var COMPONENTS = [{'name': 'AddUserComponent', 'selector': 'add-user'},{'name': 'AppComponent', 'selector': 'app-root'},{'name': 'CalendarComponent', 'selector': 'app-calendar'},{'name': 'CalendarDetailComponent', 'selector': 'app-calendar-detail'},{'name': 'DashboardComponent', 'selector': 'app-dashboard'},{'name': 'Da